import React from 'react'
import {Grid, Card }from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    LeftBar:{
        background:"#201B20",
        height:"100vh"
    },
     text:{
        height: 29,
        width: 241,
        left: 10,
        top: 10,
     },
     Heading:{
        fontSize: 18,
        fontWeight: 400,
        lineHeight: 21,
        letterSpacing:" 0em"
        
     }
  }));
export default function Filter() {
    const classes = useStyles();
    return (
        <div>
            <Card className={classes.LeftBar}>
                <div className={classes.text}>

                <h1 className={classes.Heading}>Find a rental property</h1>
                </div>
            </Card>
        </div>
    )
}
